//import Main from "./Main";
import React, { Component } from "react";
import "./index.css";


class CorpsCom extends React.Component {

  constructor(props) {
  super(props);

  this.state = {
    publicationContenu:'',
    items:[]
  };
}

  render() {
    return (
     <div>
    <br/><br/><br/><br/>
    <div class="container-fluid">
      <div class="row">
        <div class="col-lg-3 col-md-3 col-sm-3 col-xs-3">
        </div>
        <div class="col-lg-6 col-md-6 col-sm-6 col-xs-6">

          <form>
            <input value ={this.state.publicationContenu} type="text" placeholder="Inserez votre publication"></input>
          </form>
          <button class="w3-button w3-xlarge w3-circle w3-black">Ajouter</button>
        </div>
        <div class="col-lg-3 col-md-3 col-sm-3 col-xs-3">
        </div>
      </div>
    </div>
    </div>
    );
  }
}

//export default NavigationCorps;

